  \"2013-03-15T23:53:09.471849\",\n\t\"name\": \"california-well-log-observations\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data contain basic information describing
  well logs and compiled by the California Division of Oil, Gas, and Geothermal Resources
  (CA DOGGR), published as a downloadable file, ESRI Service, and as a Web Feature
  service for the National Geothermal Data System . The downloadable documents contain
  9 worksheets, including information about the template, notes related to revisions
  of the template, resource provider information, the data, a field list (data mapping
  view) and a worksheet with vocabularies for use in populating the spreadsheet (data
  valid terms). Fields in the data table include Well Name, API Number, Ended Drilling
  Date, Well Type, Bottom Logged Interval,and Log Notes. \",\n\t\"license_title\":
